import styled from "styled-components";

export const Button = styled.button`
  margin-left: 20px;
  background-color: #d7d2d2;
  border-radius: 5px;
  border: none;
  cursor: pointer;
`;

export const ItemList = styled.li`
  :not(:last-child) {
    margin-bottom: 20px;
  }
`;
